import React from 'react';

export default function MembersActive(props){

    return(
        <section>
            <h3>{props.name}</h3>
            <p>Active Duration:</p>
            {
                props.period.map((members,index) =>{
                    return(
                        members.activity_periods.map(item =>{
                            return(
                                <div>Start Time:{item.start_time}</div>
                            );
                        })
                    );
                })
            }
            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
